// src/components/EasterEgg.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';

const EasterEgg = () => {
  const [eyeBlink, setEyeBlink] = useState(false);
  const [glitchText, setGlitchText] = useState(false);

  useEffect(() => {
    // Efeito de piscar do olho
    const blinkInterval = setInterval(() => {
      setEyeBlink(true);
      setTimeout(() => setEyeBlink(false), 200);
    }, 5000);

    // Efeito de glitch no texto
    const glitchInterval = setInterval(() => {
      setGlitchText(true);
      setTimeout(() => setGlitchText(false), 200);
    }, 3000);

    return () => {
      clearInterval(blinkInterval);
      clearInterval(glitchInterval);
    };
  }, []);

  return (
    <div className="min-h-screen bg-black flex items-center justify-center p-4">
      <div className="relative max-w-[400px] w-full">
        {/* Fundo com ruído */}
        <div className="absolute inset-0 bg-noise opacity-5 pointer-events-none"></div>
        
        {/* Scanlines */}
        <div className="absolute inset-0 scanlines pointer-events-none"></div>

        {/* Conteúdo Principal */}
        <div className="bg-white relative">
          {/* Cabeçalho */}
          <div className="bg-yellow-500 py-3">
            <h1 className={`text-black text-2xl font-bold text-center tracking-wide ${glitchText ? 'glitch' : ''}`}>
              ATENÇÃO!
            </h1>
          </div>

          <div className="p-8 space-y-8">
            <h2 className="text-xl font-mono font-bold text-red-800 text-center tracking-wider">
              ÁREA DE DÉJÀ VU
            </h2>

            <div className="space-y-6">
              <p className="text-center font-mono text-gray-900">
                ESTA É SUA PRIMEIRA VEZ AQUI.
              </p>

              <p className="text-center font-mono text-gray-900">
                SE ESTA PLATAFORMA PARECE
                <br />
                FAMILIAR, ALERTE
                <br />
                IMEDIATAMENTE UM DESENVOLVEDOR.
              </p>
            </div>

            {/* Olho Complexo */}
            <div className="flex justify-center py-6">
              <div className={`w-32 h-32 relative ${eyeBlink ? 'scale-y-0' : 'scale-100'} transition-transform duration-200`}>
                {/* Aura Externa */}
                <div className="absolute inset-0 bg-red-900/20 rounded-full animate-pulse"></div>
                
                {/* Círculo Principal */}
                <div className="absolute inset-2 bg-black rounded-full">
                  {/* Veias */}
                  {[...Array(6)].map((_, i) => (
                    <div
                      key={i}
                      className="absolute w-full h-1 bg-red-900/30"
                      style={{
                        top: '50%',
                        transform: `rotate(${i * 30}deg)`,
                        transformOrigin: 'center'
                      }}
                    ></div>
                  ))}
                  
                  {/* Íris */}
                  <div className="absolute inset-4 bg-red-900/40 rounded-full animate-pulse">
                    {/* Pupila */}
                    <div className="absolute inset-2 bg-black rounded-full">
                      {/* Reflexo */}
                      <div className="absolute w-2 h-2 bg-red-500 rounded-full top-1 left-1"></div>
                    </div>
                  </div>
                </div>
              </div>
            </div>

            <p className="text-center font-mono text-gray-900">
              SE VOCÊ VIR ALGO,
              <br />
              DIGA ALGO.
            </p>
          </div>

          {/* Rodapé */}
          <div className="bg-yellow-500 py-3">
            <Link to="/">
              <p className="text-black text-center text-sm font-mono hover:underline">
                Retorne imediatamente para o site da Hummand!
              </p>
            </Link>
          </div>
        </div>
      </div>

      <style jsx>{`
        .bg-noise {
          background-image: url("data:image/svg+xml,%3Csvg viewBox='0 0 400 400' xmlns='http://www.w3.org/2000/svg'%3E%3Cfilter id='noiseFilter'%3E%3CfeTurbulence type='fractalNoise' baseFrequency='0.95' numOctaves='3' stitchTiles='stitch'/%3E%3C/filter%3E%3Crect width='100%' height='100%' filter='url(%23noiseFilter)'/%3E%3C/svg%3E");
          animation: noise 0.5s infinite;
        }

        @keyframes noise {
          0% { transform: translate(0, 0); }
          10% { transform: translate(-5%, -5%); }
          20% { transform: translate(-10%, 5%); }
          30% { transform: translate(5%, -10%); }
          40% { transform: translate(-5%, 15%); }
          50% { transform: translate(-10%, 5%); }
          60% { transform: translate(15%, 0); }
          70% { transform: translate(0, 10%); }
          80% { transform: translate(-15%, 0); }
          90% { transform: translate(10%, 5%); }
          100% { transform: translate(0, 0); }
        }

        .scanlines::before {
          content: "";
          position: absolute;
          width: 100%;
          height: 100%;
          background: repeating-linear-gradient(
            to bottom,
            transparent 0%,
            rgba(0, 0, 0, 0.05) 0.5%,
            transparent 1%
          );
        }

        .glitch {
          animation: glitch-anim 0.3s ease-in-out;
        }

        @keyframes glitch-anim {
          0% { transform: none; opacity: 1; }
          7% { transform: skew(-0.5deg, -0.9deg); opacity: 0.75; }
          10% { transform: none; opacity: 1; }
          27% { transform: none; opacity: 1; }
          30% { transform: skew(0.8deg, -0.1deg); opacity: 0.75; }
          35% { transform: none; opacity: 1; }
          52% { transform: none; opacity: 1; }
          55% { transform: skew(-1deg, 0.2deg); opacity: 0.75; }
          50% { transform: none; opacity: 1; }
          72% { transform: none; opacity: 1; }
          75% { transform: skew(0.4deg, 1deg); opacity: 0.75; }
          80% { transform: none; opacity: 1; }
          100% { transform: none; opacity: 1; }
        }
      `}</style>
    </div>
  );
};

export default EasterEgg;
